package com.active.bean;/** * 这是一个类说明 * * @author * @date 2019/11/16 上午10:47 * @since 1.0 */public class TgInfo {    private  Long id;    private String name;    private String mobile;    private Integer status;    private String createTime;    private String updateTime;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getCreateTime() {        return createTime;    }    public void setCreateTime(String createTime) {        this.createTime = createTime;    }    public String getUpdateTime() {        return updateTime;    }    public void setUpdateTime(String updateTime) {        this.updateTime = updateTime;    }    public Integer getStatus() {        return status;    }    public void setStatus(Integer status) {        this.status = status;    }}